pub enum External {
    Function(u32),
    Table(TableType),
    Memory(MemoryType),
    Global(GlobalType),
}

pub enum NameSection {
    Module(ModuleNameSection),
    Function(FunctionNameSection),
    Local(LocalNameSection),
    Unparsed {
        name_type: u8,
        name_payload: Vec<u8>,
    },
}

pub enum RelocationEntry {
    FunctionIndexLeb {
        offset: u32,
        index: u32,
    },
    TableIndexSleb {
        offset: u32,
        index: u32,
    },
    TableIndexI32 {
        offset: u32,
        index: u32,
    },
    MemoryAddressLeb {
        offset: u32,
        index: u32,
        addend: i32,
    },
    MemoryAddressSleb {
        offset: u32,
        index: u32,
        addend: i32,
    },
    MemoryAddressI32 {
        offset: u32,
        index: u32,
        addend: i32,
    },
    TypeIndexLeb {
        offset: u32,
        index: u32,
    },
    GlobalIndexLeb {
        offset: u32,
        index: u32,
    },
}

